SET NAMES utf8mb4;
SET FOREIGN_KEY_CHECKS = 0;

-- ----------------------------
-- Table structure for sys_default_custom_form
-- ----------------------------
DROP TABLE IF EXISTS `sys_default_custom_form`;
CREATE TABLE `sys_default_custom_form` (
  `custom_form_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '自定义表单Id',
  `custom_form_code` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '所属对象',
  `custom_form_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '所属表单',
  `sub_id` bigint(20) DEFAULT NULL COMMENT '关联子表单',
  `from_rout` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '表单路由',
  `item_width` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '表单列宽',
  `create_user_id` bigint(20) DEFAULT NULL COMMENT '创建人id',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `modified_user_id` bigint(20) DEFAULT NULL COMMENT '修改人id',
  `modified_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '修改时间',
  `status` tinyint(1) DEFAULT '1' COMMENT '状态（0、不启用 1、启用）',
  `is_delete` tinyint(1) DEFAULT '1' COMMENT '逻辑删除（0、删除 1、正常）',
  `org_id` bigint(20) DEFAULT NULL COMMENT '组织ID',
  PRIMARY KEY (`custom_form_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4343 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='自定义表单';

-- ----------------------------
-- Records of sys_default_custom_form
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for sys_default_custom_form_det
-- ----------------------------
DROP TABLE IF EXISTS `sys_default_custom_form_det`;
CREATE TABLE `sys_default_custom_form_det` (
  `custom_form_det_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '自定义表单明细Id',
  `custom_form_id` bigint(20) DEFAULT NULL COMMENT '自定义表单Id',
  `item_key` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '字段名',
  `item_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '字段中文名',
  `show_type` tinyint(1) DEFAULT NULL COMMENT '显示类型（0-全部 1-检索条件 2-列表页 3-详情页 4-检索加列表 5-列表加详情）',
  `item_value` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '搜索用默认值',
  `item_width` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '列宽',
  `select_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '下拉自定义名称',
  `select_value` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '下拉自定义值',
  `disabled` tinyint(1) DEFAULT '0' COMMENT '是否编辑禁用（0-默认 1-禁用）',
  `item_list_type` tinyint(1) DEFAULT '0' COMMENT '列表字段属性（0-默认 1-input 2-select  3-switch 4-data）',
  `item_search_type` tinyint(1) DEFAULT '0' COMMENT '检索字段属性（0-默认 1-input 2-select  3-switch 4-data）',
  `item_detail_type` tinyint(1) DEFAULT '0' COMMENT '详情字段属性（0-默认 1-input 2-select  3-switch 4-data）',
  `is_hide` tinyint(1) DEFAULT '0' COMMENT '是否隐藏（0-否 1-是）',
  `is_enum` tinyint(1) DEFAULT '0' COMMENT '是否枚举（0-否 1-是）',
  `is_edit_display` tinyint(1) DEFAULT '0' COMMENT '是否编辑展示(0-否 1-是)',
  `spec_code` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '配置项Code',
  `event_trigger_mode` tinyint(1) DEFAULT '0' COMMENT '事件触发方式',
  `event_trigger_name` tinyint(1) DEFAULT '0' COMMENT '事件触发名称',
  `enum_data` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '枚举json',
  `is_required` tinyint(1) DEFAULT '0' COMMENT '是否必填（0-否 1-是）',
  `format` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '时间显示格式',
  `value_format` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '后台所需时间格式',
  `date_type` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '时间类型',
  `order_num` int(9) DEFAULT '0' COMMENT '排序',
  `is_search` tinyint(1) DEFAULT NULL COMMENT '是否检索(0-否 1-是)',
  `is_table` tinyint(1) DEFAULT NULL COMMENT '是否表格(0-否 1-是)',
  `is_form` tinyint(1) DEFAULT NULL COMMENT '是否表单(0-否 1-是)',
  `is_detail` tinyint(1) DEFAULT NULL COMMENT '是否详情(0-否 1-是)',
  `create_user_id` bigint(20) DEFAULT NULL COMMENT '创建人id',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `modified_user_id` bigint(20) DEFAULT NULL COMMENT '修改人id',
  `modified_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '修改时间',
  `status` tinyint(1) DEFAULT '1' COMMENT '状态（0、不启用 1、启用）',
  `is_delete` tinyint(1) DEFAULT '1' COMMENT '逻辑删除（0、删除 1、正常）',
  `org_id` bigint(20) DEFAULT NULL COMMENT '组织ID',
  PRIMARY KEY (`custom_form_det_id`)
) ENGINE=InnoDB AUTO_INCREMENT=45428 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='自定义表单明细';

-- ----------------------------
-- Records of sys_default_custom_form_det
-- ----------------------------
BEGIN;
COMMIT;

SET FOREIGN_KEY_CHECKS = 1;
